  return (
    <Card>
        <Card.Title title="La cocina de Toto"/>
        <Paragraph>“ La gente súper servicial y atenta pero hay muy poco surtido en bebidas y otros. “</Paragraph>
        <Image source={require('../../assets/corazones.png')} />
    </Card>
  )

}
